        [TestMethod]
        public async Task Person_Add_Success()
        {
            //arrange
            _personsAPI = new PersonsController(new PersonsService(_personsRepositoryMock.Object, _countryRepositoryMock.Object))
            {
                Request = new System.Net.Http.HttpRequestMessage(),
                Configuration = new HttpConfiguration()
            };

            var personRequest = new DTO.PersonRequest()
            {
                FirstName = "ahmed",
                LastName = "ali",
                Phone = "012345678912",
                CountryCode = "EG",
                Gender = "male",
                BirthDate = new DateTime(2000, 1, 1),
                Email = "test@test.com",
                Avatar = ""
            };

            var newCreatedPerson = new Person()
            {
                Id = 10,
                FirstName = "ahmed",
                LastName = "ali",
                Phone = "012345678912",
                CountryCode = "EG",
                Gender = "male",
                BirthDate = new DateTime(2000, 1, 1),
                Email = "test@test.com"
            };

            _personsRepositoryMock.Setup(x => x.IsEmailExists(personRequest.Email)).Returns(false);
            _personsRepositoryMock.Setup(x => x.IsPhoneExists(personRequest.Phone)).Returns(false);
            _countryRepositoryMock.Setup(x => x.IsCountryCodeExists(personRequest.CountryCode)).Returns(true);
            _personsRepositoryMock.Setup(x => x.Add(personRequest)).Returns(newCreatedPerson);

            //act
            var response = await _personsAPI.PostAsync(personRequest);
            var responseBody = await Task.FromResult(response.Content.ReadAsStringAsync()).Result;
            //assert
            Assert.AreEqual(System.Net.HttpStatusCode.Created, response.StatusCode);
            Assert.AreEqual(responseBody, "\"{\\\"Id\\\":10,\\\"FirstName\\\":\\\"ahmed\\\",\\\"LastName\\\":\\\"ali\\\",\\\"CountryCode\\\":\\\"EG\\\",\\\"Phone\\\":\\\"012345678912\\\",\\\"Gender\\\":\\\"male\\\",\\\"BirthDate\\\":\\\"2000-01-01T00:00:00\\\"}\"");
        }

